import Head from "next/head";

import {
    Autocomplete,
    Box,
    Button,
    Card,
    CardContent,
    Checkbox,
    Collapse,
    Container,
    Dialog,
    DialogActions,
    DialogContent,
    DialogContentText,
    DialogTitle,
    Divider,
    Grid,
    IconButton,
    InputAdornment,
    InputLabel,
    MenuItem,
    Paper,
    Select,
    Snackbar,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TablePagination,
    TableRow,
    TextField,
    Typography,
} from "@mui/material";
// import { products } from "../../__mocks__/products";
import { DashboardLayout } from "../dashboard/dashboard-layout";
import { useEffect, useState } from "react";
import ValueServices from "../../services/ValueServices";
import { Delete, Edit, Search } from "@mui/icons-material";
import { useTranslation } from "react-i18next";
import asistenciaServices from "../../services/asistenciaServices";

const Asistencias = () => {
    const [asistencias, setAsistencias] = useState([]);
    const [tipo_asunto, setTipo_asunto] = useState([]);
    const [tipo_expediente, setTipo_expediente] = useState([]);
    const [calles, setCalles] = useState([]);
    const [distritos, setDistritos] = useState([]);
    const [tecnicos, setTecnicos] = useState([]);
    const { t } = useTranslation();

    const [open_cookie, setOpen_cookie] = useState(false);




    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(10);



    useEffect(() => {
        ValueServices.getAllDistritos().then((response) => {
            setDistritos(response.data);
        });
        asistenciaServices.getAllAsistencias().then((response) => {
            console.log(response.data);
            setAsistencias(response.data);
        });
        ValueServices.getTecnicos().then((response) => {
            setTecnicos(response.data);
        });

        ValueServices.getTipoAsunto().then((response) => {
            setTipo_asunto(response.data);
        });

        ValueServices.getTipoExpediente().then((response) => {
            setTipo_expediente(response.data);
        });

        ValueServices.getCalles().then((response) => {
            setCalles(response.data);
        });
    }, []);

    // Cambiar filas por página
    const handleChangeRowsPerPage = (event) => {
        setRowsPerPage(parseInt(event.target.value, 10));
        setPage(0);
    };

    const handlePageChange = (event, newPage) => {
        setPage(newPage);
    };


    const list_expedientes_component = () => {
        return (
            <Paper
                style={{ borderRadius: "25px" }}
                sx={{ width: "100%", mb: 2 }}
                elevation={10}
            >
                <TableContainer sx={{ minWidth: 128 }} style={{ borderRadius: "25px" }}>
                    <Table>
                        <TableHead>
                            <TableRow>
                                <TableCell>{t("AÑO")}</TableCell>
                                <TableCell>{t("CÓDIGO")}</TableCell>
                                <TableCell>{t("EXPEDIENTE")}</TableCell>
                                <TableCell>{t("TÉCNICO")}</TableCell>
                                <TableCell>VíAS</TableCell>
                                <TableCell>F. ALTA</TableCell>
                                <TableCell>F. RECEP.</TableCell>
                                <TableCell>F. CUMPLI.</TableCell>
                                <TableCell>F. LÍMITE</TableCell>
                                <TableCell>F. ENTREGA</TableCell>
                                <TableCell>TOTAL</TableCell>
                                
                                <TableCell></TableCell>
                            </TableRow>
                        </TableHead>

                        <TableBody>
                            {asistencias
                                .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                                .map((asistencia, index) => {
                                    return (
                                        <TableRow key={asistencia.id} tabIndex={-1} hover>                                            
                                            <TableCell>{asistencia.anyo}</TableCell>
                                            <TableCell>{asistencia.codigo}</TableCell>
                                            <TableCell>{asistencia.expediente.id}</TableCell>
                                            <TableCell>{asistencia.tecnico.username}</TableCell>
                                            <TableCell>{asistencia.descripcion}</TableCell>
                                            <TableCell>{asistencia.f_recepcion}</TableCell>
                                            <TableCell>{asistencia.f_alta}</TableCell>
                                            <TableCell>{asistencia.f_cumplimentado}</TableCell>
                                            <TableCell>{asistencia.f_limite}</TableCell>
                                            <TableCell>{asistencia.f_entrega}</TableCell>
                                            <TableCell>{asistencia.total}</TableCell>

                                            <TableCell>
                                                <IconButton
                                                    onClick={(e) => openUpdateExp(asistencia)}
                                                    color="primary"
                                                    variant="contained"
                                                >
                                                    <Edit />
                                                </IconButton>
                                                <IconButton
                                                    onClick={function () {
                                                        deleteExpediente(asistencia.id);
                                                    }}
                                                    color="secondary"
                                                    variant="contained"
                                                >
                                                    <Delete />
                                                </IconButton>
                                            </TableCell>
                                            <Divider />
                                        </TableRow>
                                    );
                                })}
                        </TableBody>
                    </Table>
                </TableContainer>
                <TablePagination
                    rowsPerPageOptions={[1, 10, 25, asistencias.length]}
                    component="div"
                    count={asistencias.length}
                    rowsPerPage={rowsPerPage}
                    page={page}
                    onPageChange={handlePageChange}
                    onRowsPerPageChange={handleChangeRowsPerPage}
                />
            </Paper>
        );
    };

    return (
        <DashboardLayout>
            <Head>
                <title>Asistencias</title>
            </Head>
            <Box
                component="main"
                sx={{
                    flexGrow: 1,
                    py: 8,
                }}
            >
                <Container maxWidth={false}>
                    <div>
                        <Box
                            sx={{
                                alignItems: "center",
                                display: "flex",
                                justifyContent: "space-between",
                                flexWrap: "wrap",
                                m: -1,
                            }}
                        >
                            <Typography sx={{ m: 1 }} variant="h4">
                                Asistencias
                            </Typography>
                            <Box sx={{ m: 1 }}>
                                <Button
                                    onClick={function () {
                                        setOpen(true);
                                    }}
                                    color="primary"
                                    variant="contained"
                                >
                                    Crear asistencias
                                </Button>
                            </Box>
                        </Box>
                        <Paper sx={{ mb: 5, mt: 2 }} elevation={9}>
                            <Card>
                                <CardContent>
                                    <Box>
                                        <Button
                                            sx={{ mb: 1 }}
                                            onClick={(e) => buscarOpen()}
                                            variant="contained"
                                        >
                                            <Search />
                                        </Button>
                                        <div
                                            style={{
                                                borderBottom: "2px solid grey",
                                            }}
                                        ></div>
                                    </Box>
                                </CardContent>
                            </Card>
                        </Paper>
                        {list_expedientes_component()}
                    </div>
                </Container>
            </Box>

            <Snackbar
                open={open_cookie}
                autoHideDuration={6000}
                onClose={function () {
                    setOpen_cookie(false);
                }}
                message="Expediente eliminado correctamente"
            />

        </DashboardLayout>
    );
};

export default Asistencias;
